import axios from "axios"

export const createWallet = (newWallet, history) => async dispatch => {
    axios.post('http://localhost:8080/wallet', newWallet).then((res) => {
        history.push('/WalletPanel')
    }).catch((err) => {
        alert("Error")
    })
}
